ad_creative_bodies:
Nu voi înceta să vă prezint propunerile PSD, oricât de mult se vor enerva și mă vor ataca cei de la PNL. Datoria candidaților este să spună ce sunt ei în stare să facă pentru oameni, nu să-i atace pe ceilalți candidați.

Vă reamintesc că PSD a oprit plecarea medicilor din România asigurându-le venituri pe măsura calificării lor. La fel am credința că putem opri plecare tinerilor și oamenilor de valoare din România. 

Avem soluții bune în Programul PSD de guvernare:

o Primă de 1.000 de lei/lună, pe lângă salariu, pentru tinerii români care se angajează prima oară sau pentru cei care se întorc în țară;
o Primă de 12.500 de lei pentru cetățenii români care se întorc în România și se angajează pe perioadă nedeterminată;
o Vouchere de până la 800 de euro, pentru persoanele care vor să învețe o meserie mai bine plătită;
o Finalizarea Autostrăzii Moldova până la Botoșani, astfel încât să aducem investiții și locuri de muncă mai bine plătite în județul nostru!

P.S.
Știți de ce PNL nu prezintă soluțiile lor? Pentru că este mai comod să-i ataci pe alții decât să construiești un program coerent. Vă dau doar un exemplu: în programul dumnealor, PNL nu a scris nimic despre sistemul public de pensii.

CMF11240017
